import React, { useEffect } from 'react';
import '../styles/Alltransactions.css';

const TransactionList = () => {
    useEffect(() => {
        const search = document.querySelector('.input-group input');
        const tableRows = document.querySelectorAll('tbody tr');
        const tableHeadings = document.querySelectorAll('thead th');

        const searchTable = () => {
            tableRows.forEach((row, i) => {
                let tableData = row.textContent.toLowerCase();
                let searchData = search.value.toLowerCase();

                row.classList.toggle('hide', tableData.indexOf(searchData) < 0);
                row.style.setProperty('--delay', i / 25 + 's');
            });

            document.querySelectorAll('tbody tr:not(.hide)').forEach((visibleRow, i) => {
                visibleRow.style.backgroundColor = i % 2 === 0 ? 'transparent' : '#0000000b';
            });
        };

        search.addEventListener('input', searchTable);

        tableHeadings.forEach((head, i) => {
            let sortAsc = true;
            head.onclick = () => {
                tableHeadings.forEach(head => head.classList.remove('active'));
                head.classList.add('active');

                document.querySelectorAll('td').forEach(td => td.classList.remove('active'));
                tableRows.forEach(row => {
                    row.querySelectorAll('td')[i].classList.add('active');
                });

                head.classList.toggle('asc', sortAsc);
                sortAsc = head.classList.contains('asc') ? false : true;

                sortTable(i, sortAsc);
            };
        });

        const sortTable = (column, sortAsc) => {
            [...tableRows].sort((a, b) => {
                let firstRow = a.querySelectorAll('td')[column].textContent.toLowerCase();
                let secondRow = b.querySelectorAll('td')[column].textContent.toLowerCase();

                return sortAsc ? (firstRow < secondRow ? 1 : -1) : firstRow < secondRow ? -1 : 1;
            })
                .map(sortedRow => document.querySelector('tbody').appendChild(sortedRow));
        };

        return () => {
            search.removeEventListener('input', searchTable);
        };
    }, []);

    const toPDF = () => {
        // Code pour convertir en PDF
        alert('Converting to PDF...');
    };

    const toJSON = () => {
        // Code pour convertir en JSON
        alert('Converting to JSON...');
    };

    const toCSV = () => {
        // Code pour convertir en CSV
        alert('Converting to CSV...');
    };

    const toExcel = () => {
        // Code pour convertir en Excel
        alert('Converting to Excel...');
    };

    return (
      <div className='alltransaction'>
        <main className="table" id="customers_table">
            <section className="table__header">
                <h1>Transactions</h1>
                <div className="input-group">
                    <input type="search" placeholder="Search Data..." />
                    <img src="../assets/img/search.png" alt="" />
                </div>
                <div className="export__file">
                    <label htmlFor="export-file" className="export__file-btn" title="Export File"></label>
                    <input type="checkbox" id="export-file" />
                    <div className="export__file-options">
                        <label>Export As &nbsp; &#10140;</label>
                        <label onClick={toPDF}>PDF <img src="../images/pdf.png" alt="" /></label>
                        <label onClick={toJSON}>JSON <img src="../images/json.png" alt="" /></label>
                        <label onClick={toCSV}>CSV <img src="../images/csv.png" alt="" /></label>
                        <label onClick={toExcel}>EXCEL <img src="../images/excel.png" alt="" /></label>
                    </div>
                </div>
            </section>
            <section className="table__body">
                <table>
                    <thead>
                        <tr>
                            <th> Id <span className="icon-arrow">^</span></th>
                            <th> Participant<span className="icon-arrow">^</span></th>
                            <th> Type  <span className="icon-arrow">^</span></th>
                            <th> Date <span className="icon-arrow">^</span></th>
                            <th> Statut <span className="icon-arrow">^</span></th>
                            <th> Montant <span className="icon-arrow">^</span></th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>125236</td>
                            <td>Albert</td>
                            <td>Dépôt</td>
                            <td>02/10/2023</td>
                            <td>Réussie</td>
                            <td>25000 xaf</td>
                        </tr>
                        <tr>
                            <td>256387</td>
                            <td>Patricia</td>
                            <td>Dépôt</td>
                            <td>10/02/2024</td>
                            <td>Réussie</td>
                            <td>50000 xaf</td>
                        </tr>
                        <tr>
                            <td>22556</td>
                            <td>Emmanuel</td>
                            <td>Dépôt</td>
                            <td>20/01/2024</td>
                            <td>Réussie</td>
                            <td>250000 xaf</td>
                        </tr>
                        <tr>
                            <td>126356</td>
                            <td>Jules-grégoire</td>
                            <td>Dépôt</td>
                            <td>25/03/2024</td>
                            <td>Réussie</td>
                            <td>2500000 xaf</td>
                        </tr>
                        <tr>
                            <td>456998</td>
                            <td>Privat</td>
                            <td>Dépôt</td>
                            <td>30/04/2024</td>
                            <td>Réussie</td>
                            <td>250000 xaf</td>
                        </tr>
